      New Challenge Introduction:
        content1: forklaring her
        markdown: "### Ny utfordring: Knekk ein tilfeldig erstatningskode...med ein
          ny modul\n\nKvo om du i staden for å skifte heile alfabetet, kartla kvar
          bokstav i alfabetet til tilfeldige ulike bokstavar i alfabetet? Dette blir
          kalla **tilfeldig erstatningskode**.\n\n![](https://images.code.org/7837e7fef2f38659f4bf51a29b6dc4d3-image-1473863470440.gif)\n\nI
          staden for å kode den hemmelege meldinga med eit enkelt alfabetisk skifte,
          kan du no møte meldingar som er koda med **tilfeldig erstatning**.\n\n\nDette
          er mykje vanskelegare å knekke og treng eit meir sofistikert verktøy, så...\n\nNår
          du klikkar på hald fram, vil du sjå ein **ny og meir sofistikert versjon
          av krypteringsverktøyet** som viser ulike ting. \n\nMen kva det gjer er
          eit lite mysterium!  \n\n###Di oppgåve:\n\n * Finne ut kva som skjer i denne
          nye versjonen av verktøyet\n * Kva informasjon blir gitt deg?\n * Finn ut
          kva verktøyet lar deg gjere\n * Som vanleg kan du ikkje knekke det. Så klikk
          på ting, sjekk litt rundt.\n * Om du finn det ut, kan du kanskje klare å
          knekke ei melding som er koda med tilfeldig erstatning.\n\n### Hint\n\n*
          Visste du at **E** er den mest brukte bokstaven i alfabetet?\n\n### Gå saman
          med nokon og diskuter\n Etter du har leikt litt med det, bør du gå saman
          med nokon - ein partnar, ei lita gruppe, heile klassen - for å diskutere
          kva de fann ut og verifisere at de veit kva som skjer og ulike måtar de
          kan bruke verktøyet på. \n\n\n"
