      'Technique: Frequency Analysis':
        content1: forklaring her
        markdown: "# Knekke erstatningskode\n\nDen beste teknikken for å knekke ein
          tilfeldig erstatningskode er kjent som **frekvensanalyse** \n\nOmskrive
          frå: [wikipedia](https://en.wikipedia.org/wiki/Frequency_analysis)\n\n*
          **Frekvensanalyse** er ein teknikk som baserar seg på kor **ofte** (frekvens)
          ulike bokstavar dukkar opp i engelsk versus andre språk.\n* Til dømes, i
          ein del med engelsk tekst, er *E*, *T*, *A* og *O* mest vanleg, medan *Z*,
          *Q* og *X* er sjeldne. På same måte er *TH*, *ER*, *ON*, and *AN* dei mest
          vanlege bokstavane som står ved sidan av kvarandre.\n* Faktisk så er distribusjonen
          av bokstavar ganske det same for nesten *alle* døme på engelsk tekst.\n\n\nVersjonen
          på modulen for førre side er meint til å hjelpe deg å **knekke erstatningskode
          gjennom frekvensanalyse**.\n\nVed å analysere frekvensen på bokstavar i
          den krypterte meldinga samanlikna med frekvensen på bokstavar i ein typisk
          engelsk tekst, kan du komme inn på kva noko av kartlegginga av bokstavane.
          \ \n\nVerktøyet viser deg frekvensen av bokstavar i den krypterte teksten
          (oransje) samanlikna med frekvensen frå typisk engelsk (blå).\n\n### Hint:
          Kor startar ein?\n\n1. Finn dei korte orda og \"knekk\" dei først.  Kor
          mange ord på ein bokstav kjenner du til? (\"a\"). Eit veldig vanleg ord
          på tre bokstavar er \"the\".\n2. Når du har gjort det, kan du ha erstatningar
          for nokre av dei mest vanlege bokstavane.  Du kan bruke intuisjon for å
          sjå på andre ord med desse erstatningane og gitte vidare.\n3. Etter du berre
          har funne nokre få bokstavar som er vanskelege å finne, kan resten komme
          ganske kjapt.\n4. Samanlikning av frekvensen på bokstavar gir god innsikt
          for å kunne gitte bra. \n\n### Prøv dette:\nAnimasjonen under viser nokon
          som kjem i gang. Dette prøvde dei\n\n* Først sortere bokstavane etter frekvens.
          \n* Identifisere eit par med bokstavar som kan kartlegge ordet `the`.  \nDet
          er ein god start!\n\n![](https://images.code.org/4c188dfb0b284810845285b83ce5bcd4-image-1473787694329.gif)\n\n##
          Er tilfeldig erstatning bra?\n* Etter litt øving, kor lang tid tar det deg
          å knekke ein tilfeldig erstatningskode?\n* Er dette bra eller ikkje?\n\n\n"
      Terminology Recap:
        content1: forklaring her
        markdown: "# Ta pause og oppsummer \n\nMeldingar som er krypterte med **Cæsarkode**
          er veldig lette å knekke, spesielt når du har eit dataverktøy. No som du
          har litt øving med å knekke alfabetiske sifferkodar (ganske enkelt, sant?),
          la oss prøve noko meir vanskeleg. \n\n**Oppsummer terminologi:**\n\n* **Kryptering**
          – ein prosess der ein koder meldingar for å halde dei hemmelege, slik at
          berre \"autoriserte\" kan lese det.\n* **Dekryptering** – ein prosess som
          omgjer krypteringa, tar ei hemmeleg melding og reproduserar den orginale
          teksten.\n* **Kode** – det generiske namnet for ein teknikk (eller algoritme)
          som gjer krypteringa\n* **Cæsarkode** – ein krypteringsteknikk som shifter
          på alfabetet etter nokre bokstavar.\n* **Knekke kryptering** – Når du prøver
          å finne ei hemmeleg melding *utan* å vite alle spesifikasjonane i koden,
          brøver du å **knekke** krypteringa. \n\nKlikk på Hald fram for å sjå **Neste
          utfordring**...\n"
